let currWord = "";
let currRow = 0;
let guesses = [];
const LETTERS = "abcdefghijklmnopqrstuvwxyz";
const WORDS = "".match(/.{1,6}/g);
const ALL_WORDS = "".match(/.{1,6}/g);

const YELLOW = "#baab02";
const GREEN = "#00ad2e";
const GREY = "#828583";

const REFERENCE = new Date("02/07/2022");
// const DAYS_SINCE_REFERENCE = Math.floor(((new Date()) - REFERENCE)/1000/3600/24);
const DAYS_SINCE_REFERENCE = 4;
const secret = WORDS[DAYS_SINCE_REFERENCE % WORDS.length];
let shouldListen = true;

const GREENBOX = "";
const YELLOWBOX = "";
const GREYBOX = "";

const FAIL_DELIMITER = "X";

function type(key) {
  if (!shouldListen) return;
  const input = key.key;
  if (LETTERS.includes(input.toLowerCase())) {
    if (currWord.length < 6) {
      currWord += input;
      drawRow(currRow, currWord);
    }
  } else if (input === "Backspace") {
    currWord = currWord.slice(0, -1);
    drawRow(currRow, currWord);
  } else if (input === "Enter") {
    if (currWord.length < 6) return;
    if (ALL_WORDS.includes(currWord)) {
      // Valid guess
      saveGuessForToday(DAYS_SINCE_REFERENCE, currWord);
      if (currWord === secret) {
        // Correct guess
        shouldListen = false;
        correctGuess();
      } else {
        // Incorrect guess
        incorrectGuess();
        currRow++;
        if (currRow < 6) {
          // Still can play
          currWord = "";    
        } else {
          // Out of lives
          shouldListen = false;
          loseGame();
        }
      }
    } else {
      // Invalid guess
      invalidGuess();
    }
  }
}

function saveGuessForToday(dayIndex, guess) {
  let toWrite;
  const data = window.localStorage.getItem("6wordle_today");
  if (data === null || data.split(":")[0] != DAYS_SINCE_REFERENCE) {
    // Write new data
    toWrite = DAYS_SINCE_REFERENCE + ":" + guess;
  } else {
    // Add onto existing data
    const guesses = data.split(":")[1].split(",");
    guesses.push(guess);
    toWrite = DAYS_SINCE_REFERENCE + ":" + guesses.join();
  }
  window.localStorage.setItem("6wordle_today", toWrite);
}

function correctGuess() {
  inputGuess(currRow, currWord, true);
  drawSummary();
}

function incorrectGuess() {
  inputGuess(currRow, currWord, true);
}

function invalidGuess() {
  const row = document.getElementsByClassName("row")[currRow];
  for (let cell of row.children) {
    cell.animate([
      {borderColor: "red"},
      {borderColor: "white"}
    ], 500);
  }

  const message = document.getElementById("message")
  message.innerText = currWord + " is not in our word list.";
  message.animate([
      {opacity: 1},
      {opacity: 0}
    ], 2000);
}

function loseGame() {
  const answer = document.getElementById("answer");
  answer.innerText = secret;
  answer.style.display = "block";
  drawSummary();
}

function drawSummary() {
  setTimeout(() => {
    const score = (currRow === 6 ? FAIL_DELIMITER : (currRow + 1))
    saveScores(score);

    const pastScores = readScores();
    const numAttempts = pastScores.length;
    const pastSolves = pastScores.filter(x => x != FAIL_DELIMITER); 
    const numSolves = pastSolves.length;
    const avgSolve = Math.round(pastSolves.reduce((x,y)=>{return parseInt(x) + parseInt(y)}, 0) / numSolves * 100) / 100;

    document.getElementById("score").innerText += score + "/6";
    document.getElementById("attempts").innerText = numAttempts;
    document.getElementById("solves").innerText = numSolves;
    document.getElementById("avg-solve").innerText = avgSolve;

    const popup = document.getElementById("popup");
    popup.style.visibility = "visible";
    popup.style.opacity = 1;
  }, 1000)
}

function saveScores(scoreToAdd) {
  const data = readScores();
  data.push(scoreToAdd);
  const toWrite = data.join();
  window.localStorage.setItem("6wordle_scores", toWrite);
}

function readScores() {
  const data = window.localStorage.getItem("6wordle_scores");
  return data ? data.split(",") : [];
}

function closePopup() {
  document.getElementById("popup").style.visibility = "hidden";
}

function copyResults() {
  let str = "";
  for (let arr of guesses) {
    let row = "";
    for (let box of arr) {
      switch (box) {
        case 0:
          row += GREYBOX;
        break;
        case 1: 
          row += YELLOWBOX;
        break;
        case 2:
          row += GREENBOX;
        break;
      }
    }
    str += row + "\n";
  }

  let type = "text/plain";
  let blob = new Blob([str], { type });
  let data = [new ClipboardItem({ [type]: blob })];

  navigator.clipboard.writeText(str).then(
    () => {
      console.log("success");
    },
    () => {
      console.log("failure");
    }
  );
}

function inputGuess(rowIndex, word, animate) {
  const row = document.getElementsByClassName("row")[rowIndex];
  drawRow(rowIndex, word);
  let secretLeft = secret;
  // remove correct guesses
  let paint = [0, 0, 0, 0, 0, 0];
  for (let i = 0; i < 6; i++) {
    const char = word[i];
    if (secret[i] == char) {
      paint[i] = 2;
      secretLeft = secretLeft.replace(char, "");
    }
  }

  // remove right letter, wrong placement
  for (let i = 0; i < 6; i++) {
    const char = word[i];
    if (secretLeft.includes(char)) {
      paint[i] = 1;
      secretLeft = secretLeft.replace(char, "");
    }
  }

  guesses.push(paint);

  for (let i = 0; i < 6; i++) {
    const back = row.children[i].children[0];
    switch(paint[i]) {
      case 0:
        back.style.backgroundColor = GREY;
        break;
      case 1:
        back.style.backgroundColor = YELLOW;
        break;
      case 2:
        back.style.backgroundColor = GREEN;
        break;
    }
    if (animate) {
      back.style.transitionDelay = (0.15 * i) + "s";
    } else {
      back.style.transition = "unset";
    }
    back.style.transform = "translate(0)";
  }
}

function drawRow(rowIndex, word) {
  let row = document.getElementsByClassName("row")[rowIndex];
  for (let i = 0; i < 6; i++) {
    if (i < word.length) {
      row.children[i].children[1].innerText = word[i];  
    } else {
      row.children[i].children[1].innerText = "";
    }
  }
}

function tryToLoadForToday() {
  const data = window.localStorage.getItem("6wordle_today");
  if (data === null || data.split(":")[0] != DAYS_SINCE_REFERENCE) {
    return;
  }
  const wordsToDraw = data.split(":")[1].split(",");
  if (wordsToDraw.length > 6) {
    return;
  }
  for (let i = 0; i < wordsToDraw.length; i++) {
    inputGuess(i, wordsToDraw[i], false);
    currRow = i + 1;
  }
}

document.addEventListener('keydown', type);
tryToLoadForToday();